import React from 'react';
import './Home.css';
import logo from './logo.svg'
import SignUp from './SignUp'

const home = () => {
    return(
      <div>
      <div className="Home">
        <h1 className='Welcome' >This is what happens when tech meets wellness.</h1>
        <button className='Signup' onClick={this.togglePopup.bind(this)}>Sign up</button>
        {this.state.showPopup ?  
                <SignUp closePopup={this.togglePopup.bind(this)} /> : null  
              }  
      </div>
      <div>
        <img src={logo} className='logo'/>
        <p className='logoName'>SmartFast</p>
      </div>
      </div>
    );
}

export default home;
